function findLineByLeastSquares(o,n){var r=0;var q=0;var e=0;var f=0;var g=0;var i=0;var l=0;var k=0;var h=o.length;if(h!==n.length){throw new Error("The parameters values_x and values_y need to have same size!")}if(h===0){return[]}for(var p=0;p<h;p++){l=o[p];k=n[p];r+=l;q+=k;f+=l*l;e+=l*k;g++}var d=(g*e-r*q)/(g*f-r*r);var j=(q/g)-(d*r)/g;var c=[];var a=[];for(var p=0;p<h;p++){l=o[p];k=l*d+j;c.push(l);a.push(k)}return a};